INSERT INTO `articles` VALUES (1,'Cách quay số','cach-quay-so','Cach quay so',NULL,'',2,'<p>Bạn chỉ cần nhập d&atilde;y số gồm 5 chữ số v&agrave;o khung th&ocirc;ng tin &ldquo;Nhập số ở đ&acirc;y&rdquo;<br />\r\nv&agrave; bấm &ldquo;QUAY NGAY&rdquo;. Hệ thống sẽ quay ngẫu nhi&ecirc;n c&aacute;c số một c&aacute;ch tự động v&agrave; trả về kết quả, bao gồm:<br />\r\n&nbsp;<br />\r\n1 - &ldquo;Số qu&yacute; kh&aacute;ch đ&atilde; nhập kh&ocirc;ng đ&uacute;ng, vui l&ograve;ng kiểm tra tại đ&acirc;y&rdquo; c&oacute; nghĩa số của bạn kh&ocirc;ng tồn tại trong hệ thống của k-lucky. Vui l&ograve;ng li&ecirc;n hệ với Lily Nguyen để được &ldquo;hỗ trợ nhanh&rdquo; hoặc click v&agrave;o &ldquo;Kiểm tra ngay&rdquo;&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/uploads/images/content/1440_01-K8Lucky-Home-GetNumber.png\" style=\"width:80%\" /><br />\r\n2 - &ldquo;Xin ch&uacute;c mừng! &ldquo; th&ocirc;ng b&aacute;o n&agrave;y c&oacute; nghĩa bạn đ&atilde; tr&uacute;ng giải thưởng được xuất hiện trong h&igrave;nh. Bấm n&uacute;t &ldquo;nhận thưởng&rdquo; v&agrave; gửi th&ocirc;ng tin nhận qu&agrave; cho đại diện K-lucky (Lily Nguyễn).</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/uploads/images/content/1440_01-K8Lucky-Home-Prizes.png\" style=\"width:80%\" /></p>\r\n\r\n<p>3 - &ldquo;&rdquo;Cơ hội vẫn c&ograve;n!&rdquo; th&ocirc;ng b&aacute;o n&agrave;y c&oacute; nghĩa bạn chưa tr&uacute;ng giải trong lần quay số n&agrave;y. H&atilde;y giữ số để sử dụng cho Đại hội quay số ng&agrave;y 16/12. Ngo&agrave;i ra, h&atilde;y tiếp tục nhận th&ecirc;m nhiều cơ hội quay nữa - bằng c&aacute;ch click v&agrave;o n&uacute;t &nbsp;&ldquo;Nhận th&ecirc;m số&rdquo;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/uploads/images/Losing.jpg\" style=\"height:444px; width:600px\" /></p>\r\n\r\n<p>Đừng bỏ qua đại hội quay số c&ugrave;ng 500 anh em bằng c&aacute;ch tham gia event v&agrave; cập nhật th&ocirc;ng tin người tr&uacute;ng thưởng <a href=\"https://www.facebook.com/groups/quaysodoithuong\" target=\"_blank\">tại đ&acirc;y</a></p>\r\n',0,0,1,1588,'2018-10-29 11:39:01','2018-11-05 16:27:27',1,1),(2,'Lấy số từ<br> FACEBOOK','de-co-so-may-man','Lay so tu<br> FACEBOOK',NULL,'',2,'<p>C&oacute; c&aacute;c c&aacute;ch sau:</p>\r\n\r\n<p><strong style=\"text-decoration-line:underline\">C&aacute;ch 1:</strong> Tham dự v&agrave; bấm Share event của Đại hội quay số c&ugrave;ng 500 anh em của <strong>quaysodoithuong.com</strong> tại :</p>\r\n\r\n<p><a href=\"https://www.facebook.com/groups/quaysodoithuong\" target=\"_blank\">https://www.facebook.com/groups/quaysodoithuong</a></p>\r\n\r\n<p>Tham gia v&agrave;o group : <a href=\"https://www.facebook.com/groups/quaysodoithuong\" target=\"_blank\">ĐẠI HỘI QUAY SỐ ĐỔI THƯỞNG</a></p>\r\n\r\n<p><a href=\"http://www.facebook.com/groups/quaysodoithuong\" target=\"_blank\"><img alt=\"\" src=\"/uploads/images/content/fb.png\" style=\"height:67px; width:67px\" /></a></p>\r\n\r\n<p>Post l&ecirc;n tường c&aacute; nh&acirc;n với y&ecirc;u cầu:</p>\r\n\r\n<ul>\r\n	<li>Chế độ c&ocirc;ng khai</li>\r\n	<li>D&ugrave;ng HashTag<strong> #quaysodoithuong</strong></li>\r\n	<li>Tag th&ecirc;m 5 bạn trong list</li>\r\n	<li>Nội dung bất kỳ.</li>\r\n</ul>\r\n\r\n<p>EX: tham khảo h&igrave;nh b&ecirc;n dưới</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/uploads/images/content/quay-so-fb.JPG\" style=\"width:90%\" /></p>\r\n\r\n<p><br />\r\n<strong><u>C&aacute;ch 2: </u></strong>Đăng k&yacute; t&agrave;i khoản tại hệ thống của chương tr&igrave;nh để chơi c&aacute;c game dự đo&aacute;n v&agrave; giải tr&iacute; tương t&aacute;c của <strong>quaysodoithuong.com</strong> v&agrave; nhận v&ocirc; số v&eacute; may mắn c&ugrave;ng với mu&ocirc;n v&agrave;n qu&agrave; thưởng hấp dẫn. Vui l&ograve;ng li&ecirc;n hệ <a href=\"https://zalo.me/g/ntxbmu208\" target=\"_blank\"><strong>LiLy Nguyen</strong></a> để biết th&ecirc;m chi &nbsp;tiết. Đăng k&yacute; xong sẽ nhận ngay 1 số may mắn</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/uploads/images/content/logo.png\" style=\"width:90%\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>________________________</p>\r\n\r\n<p>*Lưu &yacute;: Tất cả c&aacute;c số may mắn, nếu kh&ocirc;ng tr&uacute;ng thưởng ở đợt 1, h&atilde;y giữ lại, v&igrave; bạn vẫn được tham gia v&agrave;o đại hội quay số 500 anh em v&agrave;o ng&agrave;y 16/12. Đừng bỏ lỡ cơ hội của m&igrave;nh!</p>\r\n',0,0,2,1589,'2018-10-29 11:53:48','2018-11-05 16:30:56',1,1),(3,'Cách Nhận Số','nhan-so-tu-giao-dich','Cach Nhan So',NULL,'',2,'<p>Bước 1: Từ trang chủ <strong>quaysodoithuong.com</strong> , chọn <a href=\"javascript:void(0)\" id=\"btnNhanSo\">NHẬN TẠI Đ&Acirc;Y</a><br />\r\nBước 2: nhập c&aacute;c th&ocirc;ng tin trong Form mẫu y&ecirc;u cầu:</p>\r\n\r\n<p><u><strong>Ch&uacute; &yacute;: </strong></u></p>\r\n\r\n<p>- C&aacute;c bạn chưa c&oacute; t&agrave;i khoản hoặc chưa biết t&agrave;i khoản tại hệ thống vẫn c&oacute; thể xin một số để quay, chỉ cần nhập Họ T&ecirc;n, Th&ocirc;ng tin ZALO, email.</p>\r\n\r\n<p>- Th&ocirc;ng tin nhập phải ch&iacute;nh x&aacute;c, để chương tr&igrave;nh li&ecirc;n hệ ri&ecirc;ng từng c&aacute;c nh&acirc;n qua ZALO cấp số</p>\r\n\r\n<p>- Nếu chưa c&oacute; ZALO th&igrave; c&aacute;c v&agrave;o <strong><a href=\"https://www.facebook.com/groups/quaysodoithuong/\">GROUP FACEBOOK</a></strong> của chương tr&igrave;nh v&agrave; để lại comment để BTC li&ecirc;n hệ qua Facebook.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/uploads/images/content/nhap-thong-tin.jpg\" style=\"width:90%\" /></p>\r\n\r\n<p>Bước 3: nhấn GỬI ĐI v&agrave; chỉ cần chờ xử l&yacute;.<br />\r\n<u><strong>CH&Uacute; &Yacute;: </strong></u>gi&aacute; trị giao dịch c&agrave;ng cao th&igrave; th&agrave;nh vi&ecirc;n c&agrave;ng nhận được nhiều số may mắn để quay v&agrave; c&agrave;ng tăng th&ecirc;m cơ hội tr&uacute;ng giải cho